// BottomNav.js
import React from "react";
import "./BottomNav.css";
import { Home, PlusCircle, User, Search } from "lucide-react";

function BottomNav() {
  return (
    <div className="bottom-nav">
      <div className="bottom-nav__item">
        <Home className="bottom-nav__icon" />
        <span>Главная</span>
      </div>
      <div className="bottom-nav__item">
        <Search className="bottom-nav__icon" />
        <span>Поиск</span>
      </div>
      <div className="bottom-nav__item">
        <PlusCircle className="bottom-nav__icon" />
        <span>Добавить</span>
      </div>
      <div className="bottom-nav__item">
        <User className="bottom-nav__icon" />
        <span>Профиль</span>
      </div>
    </div>
  );
}

export default BottomNav;
